import React from 'react'

export default class ColorSelect extends React.Component{

    render(){
        return(
            <div className="ui four item menu">
                <div onClick={() => this.props.handleChange('red')} className='ui massive red button'>Red</div>
                <div onClick={() => this.props.handleChange('yellow')} className='ui massive yellow button'>Yellow</div>
                <div onClick={() => this.props.handleChange('blue')} className='ui massive blue button'>Blue</div>
                <div onClick={() => this.props.handleChange('green')} className='ui massive green button'>Green</div>
            </div>
        )
    }
}
